import React from "react";
import "../styles/Experience.css";

function Experience() {
  return (
    <section className="experience">
      <h2>Experience</h2>
      <div className="timeline">
        <div className="timeline-item">
          <div className="timeline-dot" />
          <div className="timeline-content">
            <h3>Frontend Intern @ Bano Qabil Incubation Center</h3>
            <p>3 months internship building real-world projects using React, CSS, and JavaScript.</p>
          </div>
        </div>
        <div className="timeline-item">
          <div className="timeline-dot" />
          <div className="timeline-content">
            <h3>Freelance Developer</h3>
            <p>Working on client-based frontend projects with Next.js, animations, and UI polishing.</p>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Experience;
